  // Selected style (sort goods)
  $.fn.dropdownselect = function (options) {

    return this.each(function () {
      var
        dropdown = '',
        $select = $(this),
        $element = $('<div class="dropdown"></div>'),
        $options = $(this).children('option'),
        $button = $('<button class="btn btn-default dropdown-toggle" type="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false"><span class="text"></span>  <span class="caret-angle"><i class="fa fa-angle-down"></i></span></button>'),
        $text = $button.find('.text'),
        $active  = $options.filter('[selected]');
      if (!$active.length) {
        $active = $options.first();
      }
      $text.text($active.text());
      $button.appendTo($element);

      dropdown += '<ul class="dropdown-menu">';

      if ($select.hasClass('sort')) {
        $options = $options.dropdownSort();
      }
      $options.each(function () {
        var value = $(this).attr('value');
        if (value) {
          dropdown += '<li><a href="' + value + '">' + $(this).text() + '</a></li>';
        }
      });
      dropdown += '</ul>';
      $(dropdown).find('a').click(function(event) {
        event.preventDefault();
        $text.text($(this).text());
        $select.val($(this).attr('href'));
      }).end().appendTo($element);
      $select.hide().after($element);
    });
  };

  $.fn.dropdownSort = function () {
    return $($(this).toArray().sort(function(a, b) {
      return $(a).text() > $(b).text() ? 1 : -1;
    }));
  };

